import axios from "axios";
import { AnimatePresence, motion } from "framer-motion";
import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import styled from "styled-components";

const Container = styled.div`
  position: relative;
  margin: auto;
  margin-bottom: 100px;
  margin-top: 30px;
  background-color: whitesmoke;
  border-radius: 10px;
  height: 300px;
  width: 90%;
  overflow: hidden;
  box-shadow: 0 2px 3px rgba(0, 0, 0, 0.1), 0 10px 20px rgba(0, 0, 0, 0.2);
  @media screen and (max-width: 700px) {
    height: 440px;
  }
`;

const Slider = styled(motion.div)`
  position: absolute;
  display: grid;
  grid-template-columns: repeat(4, 1fr);
  gap: 10px;
  width: 100%;
  text-align: center;
  @media screen and (max-width: 700px) {
    grid-template-columns: repeat(2, 1fr);
  }
`;

const PlaceBox = styled(motion.div)`
  position: relative;
`;

const Rating = styled.div`
  position: absolute;
  font-size: 18px;
  top: 35px;
  right: 36px;
  background-color: rgba(0, 0, 0, 1);
  border-radius: 10px;
  padding: 3px;
  color: white;
`;

const PlaceImg = styled(motion.img)`
  margin-top: 30px;
  background-color: white;
  width: 80%;
  height: 250px;
  background-size: cover;
  background-position: center center;
  border-radius: 10px;
  color: black;
  box-shadow: 3px 3px 3px rgba(0, 0, 0, 0.1);
  cursor: pointer;
  @media screen and (max-width: 700px) {
    height: 170px;
  }
`;

const PlaceTitle = styled(motion.div)`
  position: absolute;
  width: 60%;
  height: 40px;
  bottom: -10px;
  color: white;
  font-size: 20px;
  border-radius: 5px;
  background-color: rgba(178, 178, 178, 0.7);
  left: 20%;
  word-wrap: break-word;
`;

const NextBtn = styled.img`
  width: 30px;
  position: absolute;
  right: 0;
  top: 50%;
  cursor: pointer;
`;

const PrevBtn = styled.img`
  width: 30px;
  position: absolute;
  left: 0;
  top: 50%;
  cursor: pointer;
`;

const SliderVar = {
  hidden: (isBack) => ({
    x: isBack ? -window.outerWidth + window.outerWidth / 10 : window.outerWidth - window.outerWidth / 10,
  }),
  visible: {
    x: 0,
  },
  exit: (isBack) => ({
    x: isBack ? window.outerWidth - window.outerWidth / 10 : -window.outerWidth + window.outerWidth / 10,
  }),
};

interface RestaurantForm {
  img: string;
  restaurantId: number;
  restaurantName: string;
  rating: number;
}

export default function WholePlace() {
  const [index, setIndex] = useState(0);
  const [back, setBack] = useState(false);
  const [leaving, setLeaving] = useState(false);
  const [restaurantData, setRestaurantData] = useState<RestaurantForm[]>([]);
  const navigate = useNavigate();

  const nextPlease = async () => {
    if (leaving) return;
    toggleLeaving();
    await setBack(false);
    setIndex((prev) => (prev === restaurantData.length - 4 ? 0 : prev + 4));
  };

  const prevPlease = async () => {
    if (leaving) return;
    toggleLeaving();
    await setBack(true);
    setIndex((prev) => (prev === 0 ? restaurantData.length - 4 : prev - 4));
  };

  const toggleLeaving = () => setLeaving((cur) => !cur);

  const handleImageClick = (restaurantId: number) => {
    navigate(`/place/${restaurantId}`);
  };

  useEffect(() => {
    async function fetchRestaurant() {
      try {
        const response = await axios.get('/restaurantData');
        const shuffledImages = response.data.restaurantData.sort(() => Math.random() - 0.5);
        setRestaurantData(shuffledImages);
      } catch (error) {
        console.error('Error fetching restaurant data:', error);
      }
    }
    fetchRestaurant();
  }, []);

  return (
    <Container>
      <AnimatePresence initial={false} onExitComplete={toggleLeaving}>
        <Slider
          custom={back}
          variants={SliderVar}
          initial="hidden"
          animate="visible"
          exit="exit"
          transition={{ type: "tween", duration: 1 }}
          key={index}
        >
          {restaurantData.slice(index, index + 4).map((restaurant, idx) => (
            <PlaceBox
              key={idx}
              whileHover={{ scale: 1.1 }}
              onClick={() => handleImageClick(restaurant.restaurantId)}
            >
              <PlaceImg src={restaurant.img} alt={restaurant.restaurantName} />
              <Rating>
                <span style={{ color: "rgba(30, 144, 255,1.0)" }}>&#9733;</span> {restaurant.rating}
              </Rating>
              <PlaceTitle>{restaurant.restaurantName}</PlaceTitle>
            </PlaceBox>
          ))}
        </Slider>
        <PrevBtn src={process.env.PUBLIC_URL + "/back.png"} onClick={prevPlease} />
        <NextBtn src={process.env.PUBLIC_URL + "/next.png"} onClick={nextPlease} />
      </AnimatePresence>
    </Container>
  );
}
